import { useState } from 'react';
import './Statistics.sass';

export function setState(el:number) {
    let states: number[] = [];
    states.push(el);
    return states;
}

const Statistics = () => {
    return(
        <div className='statistics'>
            <button onClick={(event: React.MouseEvent<HTMLButtonElement>) => setState(1)} className="statistics__btn">Статистика за день</button>
            <button className="statistics__btn">Статистика за тиждень</button>
            <button className="statistics__btn">Статистика за місяць</button>
            <button className="statistics__btn">Статистика за рік</button>
        </div>      
    )
}

export default Statistics;
